'use strict';

// MODULES //

var resolve = require( 'path' ).resolve;


// MAIN //

var valid = [];
var test;

test = {
	'code': [
		'// VARIABLES //',
		'',
		'var arr = new Array( 10 );'
	].join( '\n' ),
	'filename': resolve( './unvalidated.js' )
};
valid.push( test );

test = {
	'code': [
		'var res = Math.pow( 3.0, 2.0 );'
	].join( '\n' ),
	'filename': resolve( './unvalidated.js' )
};
valid.push( test );


// EXPORTS //

module.exports = valid;
